import React, { useState, useEffect } from "react";
import api from "../utils/api";
import { useAuth } from "../context/AuthContext";

const PurchasesPage = () => {
  const { role, base } = useAuth();

  const [form, setForm] = useState({
    equipmentType: "",
    quantity: "",
    base: base || "", // base assigned to user
  });

  const [purchases, setPurchases] = useState([]);
  const [filter, setFilter] = useState({
    equipmentType: "",
    date: "",
  });

  // ðŸ“¤ Fetch Purchases on Load/Filter Change
  useEffect(() => {
    const fetchPurchases = async () => {
      try {
        const res = await api.get("/purchases", {
          params: filter,
        });
        setPurchases(res.data);
      } catch (err) {
        console.error("Error fetching purchases:", err);
      }
    };

    fetchPurchases();
  }, [filter]);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await api.post("/purchases", form);
      alert("Purchase recorded successfully!");
      setForm({ equipmentType: "", quantity: "", base: base });
      setFilter({ ...filter }); // trigger refresh
    } catch (err) {
      console.error("Error recording purchase:", err);
    }
  };

  return (
    <div className="container">
      <h2>Purchase Asset</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="equipmentType"
          placeholder="Equipment Type"
          value={form.equipmentType}
          onChange={handleChange}
          required
        />
        <input
          type="number"
          name="quantity"
          placeholder="Quantity"
          value={form.quantity}
          onChange={handleChange}
          required
        />
        {/* If admin, allow selecting base manually */}
        {role === "Admin" && (
          <input
            type="text"
            name="base"
            placeholder="Base Name"
            value={form.base}
            onChange={handleChange}
            required
          />
        )}
        <button type="submit">Submit Purchase</button>
      </form>

      <hr />
      <h3>Past Purchases</h3>

      {/* Filters */}
      <div>
        <input
          type="text"
          placeholder="Filter by Equipment Type"
          value={filter.equipmentType}
          onChange={(e) =>
            setFilter({ ...filter, equipmentType: e.target.value })
          }
        />
        <input
          type="date"
          value={filter.date}
          onChange={(e) => setFilter({ ...filter, date: e.target.value })}
        />
      </div>

      {/* Purchase Table */}
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>Equipment</th>
            <th>Qty</th>
            <th>Base</th>
          </tr>
        </thead>
        <tbody>
          {purchases.map((p) => (
            <tr key={p._id}>
              <td>{new Date(p.date).toLocaleDateString()}</td>
              <td>{p.equipmentType}</td>
              <td>{p.quantity}</td>
              <td>{p.base}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PurchasesPage;
